import React from 'react';
import Grid from '@mui/material/Grid';
import Container from '@mui/material/Container';
import Box from '@mui/material/Box';
import { styled } from '@mui/material/styles';
import heroImage from '../src/hero.svg';
import serviceImg from '../src/serviceImg.svg';
import one from '../src/one.svg';
import two from '../src/two.svg';
import three from '../src/three.svg';
import four from '../src/four.svg';
import Typography from '@mui/material/Typography';

const StyledContainer = styled(Container)(({ theme }) => ({
  position: 'relative',
  width: '100%', // Adjusted width for responsiveness
  background: '#F2E7D6',
  paddingTop: '5%',
  paddingBottom: '5%',
  [theme.breakpoints.up('md')]: {
    width: '70%', // Adjusted width for larger screens
    marginLeft: '20%',
  },
}));

const StyledGridItem = styled(Grid)(({ theme }) => ({
  fontSize: 25,
  fontFamily: 'josefin sans',
  alignItems: 'center',
  position: 'relative',
  padding: theme.spacing(2), // Add padding for spacing
}));

const StyledImage = styled('img')({
  height: '80px',
  width: '80px',
});

function Processsteps() {
  return (
    <StyledContainer maxWidth="xl">
      <Grid container spacing={0} alignContent="flex-start" justifyContent="center">
        <StyledGridItem item xs={12} md={6}>
          <StyledImage src={one} alt="Step 1" />
          <Typography variant="body1">
            <strong>Requirement Gathering</strong>: Initial focus on collecting necessary information on the business,
            founder, and project. This includes an initial meeting and client intake form. Here is where the scope of work
            is defined.
          </Typography>
        </StyledGridItem>
        <StyledGridItem item xs={12} md={6}>
          <StyledImage src={two} alt="Step 2" />
          <Typography variant="body1">
            <strong>Prototyping</strong>: Development of proposal and initial draft of deliverables. Clients can get a feel
            for the quality of provided work.
          </Typography>
        </StyledGridItem>
        <StyledGridItem item xs={12} md={6}>
          <StyledImage src={three} alt="Step 3" />
          <Typography variant="body1">
            <strong>Creation & Delivery</strong>: Project is developed and delivered for clients. Clients can provide their
            feedback and ask for edits. There is no set number of revisions; the focus is on revising until the client is
            happy.
          </Typography>
        </StyledGridItem>
        <StyledGridItem item xs={12} md={6}>
          <StyledImage src={four} alt="Step 4" />
          <Typography variant="body1">
            <strong>Next Steps & FAQ</strong>: Clients can ask questions regarding the deliverables and determine if any
            next steps are necessary.
          </Typography>
        </StyledGridItem>
      </Grid>
    </StyledContainer>
  );
}

export default Processsteps;
